<!DOCTYPE html>
<html lang="zh-hant">
<head>
    <meta charset="UTF-8">
    <style>
        html {
            width: 100vw;
            height: 100vh;
        }

        body {
            background-color: transparent;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            overflow: hidden;
        }

        div {
            width: auto;
            height: auto;
            padding: 20px;
            border-radius: 150px;
            background-color: rgba(140, 181, 255, 0.55);
        }

        img {
            -webkit-user-drag: none;
            -webkit-user-select: none;
            width: 120px;
            height: 120px;
            /*-webkit-animation: spin 0.6s infinite alternate;*/
        }

        @keyframes spin {
            0%{
                /*transform: rotateY(0deg);*/
                transform: scale(0.3);
            }
            100%{
                /*transform: rotateY(360deg);*/
                transform: scale(1);
            }
        }
    </style>
</head>
